VALUES ('8410063073637', 'Anguriñas', 'L GLI 28/04/ INGREDIENTES: girasol, aroma con extracto de pescado (soja, moluscos) Surimi 47% (pescado), agua, aceite de almidón, sal, almidón modificado, clara de huevo, proteína vegetal, potenciadores del sabor (glutamato de monosodio, E 635), tinta de sepia (moluscos). Puede contener crustáceos. SIN GLUTEN. SIN LACTOSA, PREPARACIÓN: Las Anguriñas Pescanova están listas para consumir. Retire del envase y añada directamente a ensaladas, salpicones, revueltos, salteadgs... o prepare según la receta escogida. ANGURINAS AL iABRE AJILLO: Dorar 2 6 3 láminas de ajo en 2 a 4 cucharadas de aceite de oliva. Añadir guindilla troceada y las Anguriñas. Cocinar a fuego lento y remover durante 1/2 minuto. Servir calientes. FACIL!', 'https://static.openfoodfacts.org/images/products/841/006/307/3637/front_es.3.400.jpg', '13.6', '1.3', '7.5', '1.2', '0', '8.8', '1.6', '0.62992125984252', '0', '0');

