INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8410076471246', 'Fajita Kit', 'Tortillas de farine de blé (326g): Farine de blé, eau, stabilisant (glycérol), huile de tournesol, émulsifiant (mono - et diglycérides d\'acides gras), dextrose, poudre à lever (carbonate acide de sodium, diphosphate disodique), sel de cuisine.  Salsa aux tomates (144g): Tomates (61%), oignons (16%), poivrons verts (10%), concentré de tomates, sel de cuisine (1,3%), vinaigre d\'alcool, oignons déshydratés, sucre, oignon en poudre, jus de citron concentré piment Guajillo (0,4%), ail en poudre, épices, correcteur d\'acidité (acide citrique). Mélange aux épices pour fajitas (30g): Sucre, légumes déshydratés (oignon, ail), sel de cuisine, arômes de fumée, deprotéines hydrolysées de soja, épices (5,5%)(poivre noir, piment de Cayenne, gingembre), correcteur d\'acidité (acetate de sodium, acide citrique), extrait de levure, colorant (caramel ordinaire). Allergènes: voir les ingrédients en gras.', 'https://static.openfoodfacts.org/images/products/841/007/647/1246/front_fr.3.400.jpg', '3.7', '0.8', '40', '6.1', '1.8', '6.8', '2.07', '0.81496062992126', '', '0');

