VALUES ('8410076471543', 'Kit pour Fajitas Original', 'Galettes de blé souples natures (163g) : farine de _blé_, eau, stabilisant: glycérol, huile de tournesol, émulsifiant: mono- et diglycérides d\'acides gras, dextrose, poudres à lever:carbonate acide de sodium, diphosphate disodique; sel. Sauce Original salsa (85g): tomates (61 %), oignons (16 % ), poivrons verts (10 %), concentré de tomate, sel, vinaigre, copeaux d\'oignons déshydratés, sucre oignon en poudre, jus de citron concentré, piment Guajilo (0,4 %), ail en poudre, épices, correcteur d\'acidité: acide citrique. Mélange aux épices pour Fajita (15g): sucre, légumes déshydratés (oignon, ail, sel, arômes, arôme de fumée, protéines hydrolysées de _soja_, épices (5,5 % (poivre noir, piment de Cayenne, gingembre), correcteurs d\'acidité : acétate de sodium, acide citrique; extrait de levure, colorant: caramel ordinaire.', 'https://static.openfoodfacts.org/images/products/841/007/647/1543/front_fr.7.400.jpg', '3.5', '0.8', '38.3', '6.1', '1.9', '6.5', '2.3', '0.905511811023622', '', '0');

